INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(1, 'It’s always safe to upload personal images onto the Internet.', 'True', 'False', '', '', '', 'Online contents could be edited and re-used to facilitate criminal acts such as impersonation scams.', 'E', 2, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(2, 'Prevention is the best measure to combat cybercrime.', 'True', 'False', '', '', '', 'Take prevention measures such as using strong password, installing anti-malware etc to protect yourself from becoming a victim of cybercrime.', 'E', 1, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(3, 'How can you tell if a website secures its traffic?', 'Google it', 'Look for ‘https’ in a URL or the lock icon', 'All websites encrypt their traffic by default', 'Encrypted sites take longer to load', '', 'The lock icon or ‘https’ suggests that website is secured as data is encrypted using secure socket layer (SSL).  Generally, a 3rd party could not see your information. ', 'E', 2, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(4, 'Emails, internet browsers and messaging apps are some of the commonly used Internet and communication platforms. Can you trust if they are secure at all times?', 'Yes', 'No', '', '', '', 'Online contents could be edited and re-used to facilitate criminal acts.  Malwares could be embedded in email links and Apps to allow cybercriminal to take control of your electronic devices.', 'E', 2, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(5, 'You have just lost your phone. What should you do? ', 'Call your phone and make arrangement to meet the person who found it in a safe environment', 'Try to locate its whereabouts using available software', 'Remotely disable your phone as soon as possible', 'All of the above', '', 'Softwares that help to locate your phone include:\r\n- Find My iPhone app on Apple’s devices;\r\n- Android Device Manager in Google Android devices;\r\n- Find My Phone for Windows platforms; and\r\n- Where’s My Droid;\r\n', 'E', 4, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(6, 'What are some measures you can take to stay safe on Wi-Fi Networks?', 'Enable your device’s firewall', 'Secure your home Wi-Fi network with a strong password and enable encryption on your access point', 'Beware of “Free Wi-Fi” hotspots which may masquerade as legitimate source', 'Use 2-factor authentication (2FA) for enhanced protection ', 'All of the above', 'All of the above. Protect yourself over Wi-Fi!', 'E', 5, 5);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(7, 'What are the risks that you are exposed to if you reveal personal details, financial information, and pictures online?', 'Identity theft', 'Unauthorised transfer of funds', 'Extortion', 'Cheating', 'All of the above', 'All of the above. Do not reveal sensitive personal information online.', 'E', 5, 5);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(8, 'You receive a call from a courier company informing you that you have a parcel detained at the Customs.   You were directed by the caller to download and install an app on your mobile phone, and to enter your personal details, i-Banking login credentials and One-Time-Password (OTP) revealed on your i-Banking token into the app. Should you follow the instructions given by the caller?', 'Yes', 'No', '', '', '', 'No government agency will inform you to make a payment through a telephone call, especially to a third party''s bank account. Cybercriminal can use malicious app to steal sensitive personal banking information to make unauthorised transfers from your bank account. You should never reveal your personal details, i-Banking login credentials and OTP to anyone.', 'E', 2, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(9, 'You receive a call from a courier company informing you that you have a parcel detained at the Customs. You were directed by the caller to visit a particular website and key in your personal details, i-Banking login credentials and One-Time-Password (OTP) revealed on your i-Banking token in order to have the parcel released. Should you follow the instructions given by the caller?', 'Yes', 'No', '', '', '', 'No government agency will inform you to make a payment through a telephone call, especially to a third party''s bank account. Cybercriminal can use your personal banking information to make unauthorised transfers from your bank account. You should never reveal your personal details, i-Banking login credentials and OTP to anyone.', 'E', 2, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(10, 'You received a phone call notifying that you have won a lottery. You are asked to pay an administration fee in order to claim the winnings.', 'Negotiate for a lower administration fee and pay the fee if it is reduced', 'Do not pay the administration fee', 'Pay the administration fee after checking what the fees are for', 'Pay the fee if the administration fee is lower than the prize amount', '', 'Do not make any payments in order to claim prize money. Winning a draw should not require advance payments.', 'E', 2, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(11, 'Your FaceBook friend, Jane, whom you have never met before asks you if she could transfer some money into your account and then for you to help her transfer the money to someone else. In return, she offers you some money for your assistance. What should you do?', 'Decline the request', 'Agree to the request but decline the reward  ', 'Agree to the request and the reward', 'Agree to transfer a smaller amount and accept a smaller reward', '', 'You should decline any request by online acquaintances for money transfers. You may become an accomplice to a crime if these monies are found to be proceeds of a crime. Be aware that criminals may spend months or years to cultivate an ‘online’ relationship with you to gain your trust.', 'E', 1, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(12, 'Which of the two emails is fake?', 'fake', 'real', '', '', '', 'Phishing emails are sent to induce you to click on the URL link in the email. Hover the mouse over the embedded link to reveal the destination URL. In this case, the destination URL not associated with the official SingPass website.', 'E', 1, 2);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(13, 'You find an unbeatable price for the latest iPhone on an online platform you haven’t used before. A week after placing the order, you are notified that your iPhone is stuck at customs and requires an additional shipping tax payment before it can be shipped. What should you do?', 'Pay the shipping tax but after checking further about the taxes', 'Pay the shipping tax as required', 'Do not pay the shipping tax', 'Pay only if the shipping tax is reduced', '', 'Always be wary of people selling items for prices that sound too good to be true. In some online purchase scam cases, sellers may demand more payments for “taxes” and ultimately, the victim never receives the item.', 'E', 3, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(14, 'You receive a phone call from someone identifying himself as a police officer. You are under criminal investigation and need to pay a fine immediately, failing which you would face charges in court. What should you do?', 'Pay the fine without seeking legal advice', 'Pay the fine but seek legal advice afterwards', 'Clarify the details of the offense before paying the fine', 'Not pay the fine', '', 'Ignore the calls. No government agency will inform you to make a payment through a telephone call, especially to a third party''s bank account.', 'D', 4, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(15, 'Someone whom you have met online asks you to buy online shopping credits in exchange for a date. You are asked to send the receipts with your PINs online so that she can claim the credits. What should you do?', 'Insist on meeting up before passing him/her any credits or receipts', 'Decline the request', 'Send him/her the credits and receipts so you can meet up', 'Send him/her the credits and receipts only if you have made further checks on his/her background  ', '', 'Be wary of strangers who befriend you online. Ignore requests to purchase for them items especially if you have only met them online.', 'E', 2, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(16, 'Someone whom you befriended online says that she is facing some problems. She asks you to transfer some money to her overseas on account of your close relationship with her. What should you do?', 'Send him/her the requested amount of money', 'Send him/her  a smaller amount and explain it’s all you can afford', 'Not send him/her any money', 'Send him/her more money than requested as he/she means a lot to you', '', 'Do not remit or transfer money to people whom you do not know well enough.  Be cautious of such requests from persons you have acquainted online.  The criminal may spend months building rapport with you online before asking for money.', 'E', 3, 4);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(17, 'An online job advertisement offers you an attractive wage for a very simple job - receiving and transferring money to other accounts. What should you do?', 'This is a great opportunity to make some easy money. I should take up the offer.', 'I should ignore the advert as this is probably a job scam', 'These job adverts are always legitimate so I will write to the advertiser to find out more', '', '', 'Ignore job advertisements of a dubious nature and be wary of job offers that promise high returns for very little effort.', 'E', 2, 3);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(18, 'You receive a phone call from someone who tells you that your computer has been hacked. The caller offers you “lifetime protection” for a fee and directed you to run some commands on your computer to resolve the problem. What should you do?', 'Proceed with the money transfer as you don''t want your computer to be compromised', 'Ignore the call and don''t disclose your credit card details', 'Follow the person''s instructions to run the commands on your computer', '', '', 'You should ignore such calls, and never follow the caller''s instructions to install software or type commands into your computer.', 'E', 2, 3);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(19, 'You receive a message from your friend''s account on Facebook Messenger asking you to urgently purchase an iTunes stored value card for them. Do you:', 'Quickly rush down to buy the card? After all it seems urgent.', 'Text the person back to say you will help?', 'Call your friend back on the phone to find out if it was really them sending the message?', '', '', 'Never agree to an unexpected request from a friend without first verifying with them over the phone that they indeed want you to buy them the gift.', 'E', 3, 3);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(20, 'You get an official-sounding email stating that you have inherited a large fortune. To release the funds, you need to transfer administrative fees, taxes and the like. What should you do?', 'Ignore the message because it’s an inheritance scam', 'Email the person back to ask for details – this could be a good sum of money left to you by a long-lost relative.', 'Transfer the money because it’s small compared to the inheritance', '', '', 'You should ignore such communications. If something sounds too good to be true, it probably is.', 'E', 1, 3);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(21, 'You received an email from your Bank stating that there have been unauthorised logins from your account and provided you a link to verify the logins. What should you do?', 'Click on the link immediately to find out more', 'Check for signs of phishing email. Do not click on the link and verify the information with the Bank through phone.', 'Click on the link as it will bring me to the Bank’s website', '', '', 'Do not click on any links as there is always a chance you can be brought to a fake Bank website bearing similar outlook. Always call the Bank to check the authencity of the information.', 'E', 2, 3);
INSERT INTO `questions_tb` (`questions_tb_no`, `questions_tb_qn`, `questions_tb_ans1`, `questions_tb_ans2`, `questions_tb_ans3`, `questions_tb_ans4`, `questions_tb_ans5`, `questions_tb_exp`, `questions_tb_category`, `questions_tb_correct`, `questions_tb_count`) VALUES(22, 'You received a call from a person claiming to be from Singapore Police Force informing you that your account has been used for money laundering activities in China. You are then told to withdraw the money deposited and pass them to another person.\r\nWhat should you do?', 'Ignore the call and hang up.  Should there be any money deposited into your account, contact the Police immediately.', 'Accede to the request as the caller mentioned that he is from Singapore Police Force.', 'Do not withdraw the cash deposited into your account. Use it for your own personal spending instead.', '', '', 'This is the latest variant of Police Impersonation Scam.\r\n\r\nNo government agencies would request you to make any financial transaction over the phone.\r\n\r\nBy withdrawing the money deposited into your account and passing it to someone, you become a money mule and have committed an offence!', 'E', 1, 3);
